                                                <p>मण्डनदेउपुर नगरपालिकाको आयोजनामा मिति २०७८।०३।१५ गते ५० बर्ष नाघेका र अनिवार्य अवकास हुन १ बर्ष वाँकी रहेका स्वेच्छिक अवकासमा जान चाहने शिक्षकहरु तथा लाई रु १,00,000।– (एक लाख) प्रोत्सहान रकम वितरण सहित सम्मान कार्यक्रम नगर शिक्षा समितिका अध्यक्ष एवम् नगर प्रमुखको प्रमुख आथित्यतामा कार्यक्रम सम्पन्&zwj;न गरियो। उक्त कार्यक्रमका केही</p>
